export const dataReBuild = (data) => {
  // приводим данные к читаемой дате
  const dateSrc = data.toLocaleString('ru-RU', {
    day: 'numeric',
    year: 'numeric',
    month: 'numeric',
  })

  let dateDst = dateSrc.split('.').reverse().join('-')
  return dateDst
}
